column8:
beyerdynamic TG D71 ドラム用 コンデンサーマイク<br><br>Touring Gearシリーズ ドラムマイクロホン<br><br>バスドラムの集音の際、スタンドや金具を必要としないバウンダリータイプのコンデンサーマイクです。コンパクトなデザイン、優れた集音特性から低音までもしっかり出るグランドピアノなどにも最適です。耐音圧148dBという高スペック、低いアタックタイムからパーカッションにもお使いいただけます。<br><br>ステージでのラフな使用にも耐えれる耐久性を備え、また固定用の穴もボトムにあるので設備用途にも使用できます。LEDも装備しており、動作状況を把握することも可能です。<br><br>・コンデンサー型<br>・ファンタム電源：11～52V<br>・周波数特性：25～20,000Hz<br>・指向特性：ハーフカーディオイド<br>・寸法:90 x 86 x 27mm<br>・コネクター：XLR3ピンオス型<div style="background:#C00; color:#fff; margin:0; width:200px; text-align:center; padding:5px 10px; font-size:90%; border-top-left-radius:5px; border-top-right-radius:5px;">配送方法について</div>
<div style="border: 2px solid #C00; padding:10px; border-bottom-left-radius:5px; border-bottom-right-radius:5px; border-top-right-radius:5px;">商品ページ、およびご注文手続きの画面に配送方法『宅配便』と表記されておりますが、配送方法に関しましてはご注文いただいた商品やお支払い方法により弊社で「宅配便/メール便」を選択させて頂いております。何卒ご了承の上、ご理解くださいます様お願い申し上げます。</div>


