<br>
<br>
【商品詳細】<br>
犬小屋の周りの土は排尿、排便で悪臭やバイ菌、ダニなどが繁殖しています<br>
そのままですとペットの体に臭いやダニがついて不衛生です<br>
土に定期的にまくことで約1ヶ月間、消臭と抗菌を同時に行う衛生敷砂です。<br>
地面やコンクリートにまくだけでペットのフンやオシッコのニオイを取り除きます<br>
（雨などにより効果が薄れますのでその場合には再度撒いて下さい）<br>
<br>
・・・　食べても安心成分で出来ています　・・・<br>
主成分のシリカゲルは自然の石と同成分の100%天然素材です<br>
抗菌成分ユーカリ植物油はガム等に消臭効果で使用される成分で安心<br>
<br>
